result_set:
  bll:
    group: stream
    plugin: l2l3
  derived_facts:
  - db:
      base_unit: none
      data_type: number
      query: (dropped_frame_count*100.0)/(sig_frame_count+dropped_frame_count-duplicate_frame_count)
    description: Dropped Frame Percent
    display_name: Dropped Frame Percent
    name: dropped_frame_percent
    referred_facts:
    - dropped_frame_count
    - sig_frame_count
    - duplicate_frame_count
  - db:
      base_unit: none
      data_type: number
      query: prbs_bit_error_count/(prbs_fill_octet_count*8)
    description: PRBS Error Ratio
    display_name: PRBS Error Ratio
    name: prbs_bit_error_ratio
    referred_facts:
    - prbs_bit_error_count
    - prbs_fill_octet_count
  - db:
      base_unit: bits_per_sec
      data_type: integer
      query: octet_rate*8
    description: Rx Rate(bits per sec)
    display_name: Rx Rate
    name: bit_rate
    referred_facts:
    - octet_rate
  - db:
      base_unit: none
      data_type: number
      query: (dropped_frame_rate*100.0)/(sig_frame_rate+dropped_frame_rate-duplicate_frame_rate)
    description: Dropped Frame Percent Rate
    display_name: Dropped Frame Percent Rate
    name: dropped_frame_percent_rate
    referred_facts:
    - dropped_frame_rate
    - sig_frame_rate
    - duplicate_frame_rate
  - db:
      base_unit: bits
      data_type: integer
      query: octet_count*8
    description: Rx Count(bits)
    display_name: Rx Count
    name: bit_count
    referred_facts:
    - octet_count
  description: Stats for RX stream
  dimension_sets:
  - iteration
  - port
  - stream_block
  - tx_stream
  - rx_stream
